const Deck = (props) => {

    console.log(props.deck);
    if (props.deck) {
        const cards = props.deck.map(card => {
            return (
                <>
                    <div>
                        <Card name={card.cardName} search={card.queryString} />
                    </div>
                </>
            )
        })
    }


    return (
        <>
            <div>
                {Card}
            </div>
        </>
    );
}

export default Deck;
